const classicBlueBirdImageURI =
  "data:image/png;base64,";

function replaceTwitterLogo(newLogoElement) {
  newLogoElement.innerHTML = "";
  // update style of new logo element
  newLogoElement.setAttribute("id", "logo-container");

  // create new img element
  const oldLogoImage = document.createElement("img");
  oldLogoImage.className = "old-twitter-logo";
  oldLogoImage.src = classicBlueBirdImageURI;

  // append new image element
  newLogoElement.appendChild(oldLogoImage);
}

function updateFavicon() {
  var link = document.querySelector("link[rel~='icon']");
  if (!link) {
    link = document.createElement("link");
    link.rel = "icon";
    document.head.appendChild(link);
  }
  link.href =
    "data:image/png;base64,";
}

/**
 * This interval function finds the new "X" logo element on Twitter and replaces it with the classic blue bird logo.
 * It also updates the favicon of the page with the Twitter logo.
 */
let intervalId;
intervalId = setInterval(() => {
  // find new "X" logo element
  const newLogoElement = document.querySelector('[aria-label="Twitter"]');

  if (newLogoElement) {
    replaceTwitterLogo(newLogoElement);
    updateFavicon();
    clearInterval(intervalId);
  }
}, 1000);
